import React from "react";
import "./ModernTemplate.css";

const ModernTemplate = ({ resumeData, isPreview }) => {
  if (isPreview) {
    return (
      <div className="modern-template modern-preview">
        <header className="modern-header">
          <h1>John Doe</h1>
          <div className="modern-contact">
            <span>📧 john@example.com</span>
            <span>📱 (555) 123-4567</span>
            <span>📍 San Francisco, CA</span>
          </div>
        </header>

        <section className="modern-section">
          <h2>Professional Summary</h2>
          <div className="modern-content">
            <p>Experienced software developer with expertise in modern web technologies.</p>
          </div>
        </section>

        <section className="modern-section">
          <h2>Skills</h2>
          <div className="modern-skills-grid">
            <span className="modern-skill-tag">JavaScript</span>
            <span className="modern-skill-tag">React</span>
            <span className="modern-skill-tag">Node.js</span>
          </div>
        </section>

        <section className="modern-section">
          <h2>Experience</h2>
          <div className="modern-content">
            <div className="modern-experience-item">
              <h3>Senior Developer</h3>
              <p className="modern-duration">Tech Corp • 2020 - Present</p>
              <p>Leading development of enterprise web applications.</p>
            </div>
          </div>
        </section>

        <section className="modern-section">
          <h2>Education</h2>
          <div className="modern-content">
            <div className="modern-education-item">
              <h3>B.S. in Computer Science</h3>
              <p className="modern-duration">University of Technology • 2016 - 2020</p>
            </div>
          </div>
        </section>
      </div>
    );
  }

  return (
    <div className="modern-template">
      <header className="modern-header">
        <h1>{resumeData.personalInfo.fullName}</h1>
        <div className="modern-contact">
          {resumeData.contact.email && (
            <span>📧 {resumeData.contact.email}</span>
          )}
          {resumeData.contact.phone && (
            <span>📱 {resumeData.contact.phone}</span>
          )}
          {resumeData.contact.location && (
            <span>📍 {resumeData.contact.location}</span>
          )}
        </div>
      </header>

      {resumeData.professionalSummary && (
        <section className="modern-section">
          <h2>Professional Summary</h2>
          <div className="modern-content">
            <p>{resumeData.professionalSummary}</p>
          </div>
        </section>
      )}

      {resumeData.skills.length > 0 && (
        <section className="modern-section">
          <h2>Skills</h2>
          <div className="modern-skills-grid">
            {resumeData.skills.map((skill, index) => (
              <span key={index} className="modern-skill-tag">
                {skill}
              </span>
            ))}
          </div>
        </section>
      )}

      {resumeData.workExperience.length > 0 && (
        <section className="modern-section">
          <h2>Work Experience</h2>
          <div className="modern-content">
            {resumeData.workExperience.map((exp, index) => (
              <div key={index} className="modern-experience-item">
                <h3>{exp.position}</h3>
                <p className="modern-duration">
                  {exp.company} • {exp.duration}
                </p>
                <p>{exp.responsibilities}</p>
              </div>
            ))}
          </div>
        </section>
      )}

      {resumeData.education.length > 0 && (
        <section className="modern-section">
          <h2>Education</h2>
          <div className="modern-content">
            {resumeData.education.map((edu, index) => (
              <div key={index} className="modern-education-item">
                <h3>{edu.degree}</h3>
                <p className="modern-duration">
                  {edu.institution} • {edu.year}
                </p>
                {edu.gpa && <p>GPA: {edu.gpa}</p>}
              </div>
            ))}
          </div>
        </section>
      )}

      {resumeData.certifications?.length > 0 && (
        <section className="modern-section">
          <h2>Certifications</h2>
          <div className="modern-content">
            {resumeData.certifications.map((cert, index) => (
              <div key={index} className="modern-certification-item">
                <h3>{cert.name}</h3>
                <p className="modern-duration">
                  {cert.organization} • {cert.year}
                </p>
              </div>
            ))}
          </div>
        </section>
      )}

      {resumeData.languages?.length > 0 && (
        <section className="modern-section">
          <h2>Languages</h2>
          <div className="modern-content">
            {resumeData.languages.map((lang, index) => (
              <div key={index} className="modern-language-item">
                <strong>{lang.language}</strong> - {lang.proficiency}
              </div>
            ))}
          </div>
        </section>
      )}

      {resumeData.projects?.length > 0 && (
        <section className="modern-section">
          <h2>Notable Projects</h2>
          <div className="modern-content">
            {resumeData.projects.map((project, index) => (
              <div key={index} className="modern-project-item">
                <h3>{project.name}</h3>
                <p>{project.description}</p>
                <p className="modern-technologies">
                  Technologies: {project.technologies}
                </p>
              </div>
            ))}
          </div>
        </section>
      )}

      {resumeData.awards?.length > 0 && (
        <section className="modern-section">
          <h2>Awards & Achievements</h2>
          <div className="modern-content">
            {resumeData.awards.map((award, index) => (
              <div key={index} className="modern-award-item">
                <h3>{award.name}</h3>
                <p className="modern-duration">
                  {award.organization} • {award.year}
                </p>
              </div>
            ))}
          </div>
        </section>
      )}
    </div>
  );
};

export default ModernTemplate;
